    methods: {
        toggleCounty() {
            const county = event.target.id;

            this.cities = this.gradoviZupanije[county];
            const element = document.getElementById(county);
            element.classList.add("active-county");
            element.classList.add("focus-county");
            if (this.focusCounty) {
                const element2 = document.getElementById(this.focusCounty);
                element2.classList.remove("focus-county");
            }
            this.focusCounty = county;
            if (!this.activeCounties.includes(county)) {
                // If the county isn't active, add it to the active counties
                this.activeCounties.push(county);
            }
        },
        removeActiveCounty() {
            const county = event.target.id;
            const element = document.getElementById(county);
            element.classList.remove("active-county");
            // Remove the county when right-clicked
            this.activeCounties = this.activeCounties.filter(
                (c) => c !== county
            );
            if (this.focusCounty === county) {
                element.classList.remove("focus-county");
                //this.focusCounty = null; //when uncommented removes all selections
            }
        },
    },
};
